import React from "react";

class Footer extends React.Component {
  render() {
    return (
      <div className="footer">
        <div className="footer-inner">
          <div className="footer-logo">
            <p>shuuhei igarashi</p>
          </div>
        </div>
      </div>
    );
  }
}

export default Footer;
